import './home.scss'

const Home = () => {

    const Buttons =  [
        {
        id: 1,
        title: 'Red Button',
        background: 'Red',
        color: 'White',
        },
        {
        id: 2,
        title: 'Crimson Button',
        background: 'Crimson',
        color: 'White',
        },
        {
        id: 3,
        title: 'Brown Button',
        background: 'Brown',
        color: 'White',
        },
        {
        id: 4,
        title: 'Green Button',
        background: 'Green',
        color: 'White',
        },
        {
        id: 5,
        title: 'Blue Button',
        background: 'Blue',
        color: 'White',
        },
        {
        id: 6,
        title: 'Black Button',
        background: 'Black',
        color: 'White',
        },
    ]
  return (
    <div className='home'>
        <div className="buttonWrap">
            <h1 className='click'>Click a Button</h1>
            <div className="buttons">

        {Buttons.map((button) => (

            <button className="btn" style={{ background: `${button.background}`, color: `${button.color}`}}>{button.title}</button>
            ))}
            </div>
        </div>
    </div>
  )
}

export default Home
